import React from 'react';

function ContactUs(props) {
    return (
        <div className='contact-container'>
          <p>K.Venkata Sylesh</p> 
          <p>Y.Sai Pavan Kumar </p>
          <p>CH.Govardhan Satvik</p>
          <p>P.Sai Likhith</p>
          <p>M.Sai Krishna</p>
        </div>
    );
}

export default ContactUs;
